import React from 'react';
import { Route, Redirect } from 'react-router-dom';

const Auth = ({component: Component, ...rest}) => {
    return (
        <Route 
            {...rest} 
            render={ (routeProps) => {
                let data = sessionStorage.getItem('UserLogin');
                }}
        />
    );
};

export default Auth;
